      .loader{
        margin: 0 0 2em;
        height: 1000px;
        width: 20%;

        padding: 1em;
        margin: 0 auto 1em;
        display: inline-block;
        vertical-align: top;
      }
        .loader {
        position: fixed;
        z-index: 99;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: white;
        display: flex;
        justify-content: center;
        align-items: center;
    }

        width: 100px;
    }
    
    .loader.hidden {
        animation: fadeOut 1s;
        animation-fill-mode: forwards;
    }
    
    @keyframes fadeOut {
        100% {
            opacity: 0;
            visibility: hidden;
        }
    }

    }

        }
